export default function List_View() {
    const data =
        ['Use Array.map',
            'Not a for loop',
            'Give each item a unique key',
            'Avoid using array index as the key']
    return (
        <>
           const listItems = numbers.map((number) =>
            <li key={number.toString()}>
                {number}
            </li>
            );
            console.log(data)
        </>

    )
}
